import styles from '../Events/Events.module.css';

const Events = () => {
    return (
        <div>
            <section className={styles.events}>
                <div className={styles.container}>
                                    <div className={styles.products__text}>
                                <h2 className={styles.products__title}>Our New<span> Events</span></h2>
                                <div>
                                <p className={styles.products__desc}>Only in 2021 we have made more than 100,000 orders for you, your loved ones, all of you, and in 2022 we are ready to destroy the market</p>
                                </div>
                                </div>
                </div>
            </section>
        </div>
    )
}

export default Events;
